import { useContext } from "react";
import { AuthContext } from "../../context/authContext";
import "./share.scss";

const Share = () => {
  const { currentUser } = useContext(AuthContext);
  return (
    <div className="share">
      <div className="container">
        <div className="top">
          <img src={currentUser.profilePic} alt="" />
        </div>
      </div>
    </div>
  );
};

export default Share;
